namespace rvinowise.twitter.test

open System
open Xunit
open FsUnit
open rvinowise.html_parsing
open rvinowise.twitter



module twitter_space =
    
    
    let ``parse a post which shares a twitter space (audio recording)`` post =
        post
        |>Main_post.quotable_message
        |>fun core->core.audio_space
        |>function
        |Some space ->
            space.title
            |>should equal "late night e/acc space"
            space.host
            |>should equal "Beff Jezos — e/acc ⏩"
            space.audience_amount
            |>should equal 2700
        |wrong_source -> raise (Bad_post_exception($"this post should contain a twitter audio space, but here's {wrong_source}"))
        
        post
        |>Main_post.media_load
        |>should be TopLevelOperators.Empty
    
    
